import "./PersonalInfo.css";
import React from "react";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import { makeStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";
import NavButtons from "../NavButtons/NavButtons.jsx";

const useStyles = makeStyles((theme) => ({
  root: {
    "& > *": {
      marginTop: theme.spacing(2),
      width: "50ch",
    },
  },
}));

const PersonalInfo = (props) => {
  const classes = useStyles();
  const [values, setValues] = React.useState({
    name: "",
    email: "",
    pno: "",
    github: "",
    linkedin: "",
    website: "",
  });
  const [errors, setErrors] = React.useState({
    name: false,
    email: false,
    pno: false,
    github: false,
    linkedin: false,
    website: false,
  });
  const [errorMessages, setErrorMessages] = React.useState({
    name: "",
    email: "",
    pno: "",
    github: "",
    linkedin: "",
    website: "",
  });

  const handleNext = () => {};

  return (
    <div>
      <Card className="card">
        <CardContent>
          <form className={classes.root} autoComplete="on">
            <TextField
              label="Name"
              variant="outlined"
              error={errors.name}
              helperText={errors.name && errorMessages.name}
              required
            />
            <TextField label="E-mail" variant="outlined" required />
            <TextField label="Phone Number" variant="outlined" required />
          </form>
        </CardContent>
      </Card>

      <Card className="card">
        <CardContent>
          <form className={classes.root} autoComplete="on">
            <TextField label="GitHub URL" variant="outlined" />
            <TextField label="LinkedIn URL" variant="outlined" />
            <TextField label="Website URL" variant="outlined" />
          </form>
        </CardContent>
      </Card>

      <NavButtons {...props} />
    </div>
  );
};

export default PersonalInfo;
